import {WorkspaceButtonContainer} from "@/styles/atoms/WorkspaceButton";

function WorkspaceButton(props: WorkspaceButtonProps): JSX.Element {
  return (
    <WorkspaceButtonContainer activate={true}>
      <span>{props.name}</span>
    </WorkspaceButtonContainer>
  );
}

export default WorkspaceButton;
